INSERT INTO `item` VALUES (000000000000001,199.00,'Electronics','Oculus Go is a whole new way to watch in VR. With crystal clear optics and state-of-the-art 3D graphics, the headset feels more like a personal theater. Just put it on, switch it on, and enjoy the littlest, big screen around. Watch a movie on a 180” inch screen, catch a sold-out concert from the front row, or just hang out with friends from anywhere. It\'s portable, comfortable, and designed to be ready when you are. That means no wires, no PC, and no phone to drop in. All you have to do sit back, relax, and go. Immerse yourself in over 1,000 games, social apps, experiences and more.','Oculus Go Standalone Virtual Reality Headset - 32GB'),(000000000000002,129.99,'Electronics','Echo Spot is designed to fit anywhere in your home. Use 2nd generation far-field voice recognition to watch the news, see music lyrics, weather forecasts, to-do and shopping lists, browse and listen to Audible audiobooks, and more. All hands-free—just ask.','Echo Spot - Smart Alarm Clock with Alexa - Black'),(000000000000003,18.49,'Pet Supplies','A clay litter uniquely formulated combining heavy non tracking granules with medium grain. The result is an excellent clumping litter that prevents moisture from reaching the bottom of the litter box, while providing a clump that will not break apart. Ultra is perfect for multi-cat families and cat owners with sifting or mechanical litter boxes and it controls odor naturally without perfume, deodorants or chemicals.','Dr. Elsey\'s Ultra Premium Clumping Cat Litter ( Pack May Vary )'),(000000000000004,13.99,'Pet Supplies','Vet’s best flea and tick shampoo for Cats is a strong yet gentle flea treatment formulated for cats that kills fleas, flea larvae and ticks on contact without harsh chemicals. Our plant-based formula contains 100% certified natural oils With a unique blend of clove and cottonseed oil to kill fleas, flea larvae and ticks. Our proven effective formula is easy to lather and rinse, cleaning An deodorizing your cat’s coat, and leaving behind a soothing scent.. For cats and kittens 12 weeks or older. Proudly manufactured in the USA.','Vet\'s Best Flea & Tick Shampoo for Cats | Premium Shampoo & Cat Flea Treatment | 12 oz'),(000000000000005,24.95,'Pet Supplies','The ChomChom Roller is the World’s Best Pet Hair Remover. By simply moving the pet hair roller back and forth, you immediately track and pick up cat hairs and dog hairs embedded deeply in sofas, couches, beds, carpets, blankets, comforters and more. You have probably tried all types of pet hair and lint removal products… from sticky roller tapes, to products that cannot be used over and over again. With the World’s Best Pet Hair Remover, you\'ll never need another gadget! No adhesive or sticky tape, 100% reusable, no power source required, clean and convenient pet hair remover. They make great gifts!','ChomChom Roller Dog Hair Remover, Cat Hair Remover, Pet Hair Remover'),(000000000000006,6.99,'Pet Supplies','Made with tough, durable nylon ends, the funky and fun Power Chew Dura Chew Double Bone chew toy in yummy bacon flavor is the long lasting chew toy you need for your aggressive chewer. With action ridges and nubs for extra entertainment, this power chew keeps dogs busy, satisfies their natural urge to chew, and encourages positive chewing habits. Plus, the bristles raised during chewing promote clean teeth and help control plaque and tartar.','Nylabone Power Chew Dura Chew Double Bone, Bacon Dog Chew Toy, Medium'),(000000000000007,799.99,'Music Instruments','The Yamaha DGX660 piano included in this bundle is great for players of all skill levels. This popular 88-key digital piano features advanced weighted key action with a heavier touch in the low end and lighter touch in the high end--just like the hammers inside an acoustic piano! It also has a variety of interactive features that make learning, playing and sharing music fun for everyone.','Yamaha DGX660B Portable Digital Piano - (Black)'),(000000000000008,483.75,'Music Instruments','The Surge Mesh Kit is a complete 8-piece electronic drum kit that includes everything a drummer needs to play like a pro. It features a 10” dual-zone mesh snare and three 8” dual-zone mesh tom pads for great feel and natural response, plus an 8” mesh kick tower pad with pedal. Three cymbals provide a virtually unlimited range of playing expression: a ride cymbal, crash cymbal with choke function and hi-hat. Not only do the mesh heads deliver unmatched response and playability, the compact size means the Surge Kit goes where larger kits can’t. The Surge module is filled with sounds—and surprises. The backlit LCD screen makes navigation a breeze. Drum and cymbal buttons are arranged to resemble the layout of a traditional kit, so it’s simple to assign sounds and create kits quickly. The Surge module comes complete with 40 classic and modern ready-to-play kits. Easily tweak any existing kit, or create your own using the 385 superior drum, cymbal, and percussion sounds included in the Surge module.','Alesis Surge Mesh Kit - Eight-Piece Electronic Drum Kit with Mesh Heads, Chrome Rack and Surge Drum Module'),(000000000000009,511.18,'Home & Kitchen','Fusing the contemporary and classic design with this collection of 4-piece modular sectionals covered in soft linen. With plush seating and back support, each piece is accented with asymmetrical tufting and stitching to enhance your living space. Compliment the sectional with accent pillows. Available in black and navy . Dimensions : LAF one-arm loveseat 52\" x 32\" x 35\" H corner wedge 32\" x 32\" x 35\" H RAF one-arm loveseat 52\" x 32\" x 35\" H Armless chair 23\" x 32\" x 35\" H','Oliver and Smith Fur_s295blackleather_Prime Sectional Sofa Black'),(000000000000010,6.89,'Health Care','Try Band-Aid Brand Flexible Fabric Adhesive Bandages, which cover and protect minor wounds. Made with Memory-Weave fabric for comfort and flexibility, these assorted wound care bandages stretch, bend, and flex as you move. Each bandage features a Quilt-Aid Comfort Pad designed to cushion painful wounds which may help prevent reinjury. Made with a Hurt-Free Pad, these comfortable first-aid bandages won\'t stick to the wound as they wick away blood and fluids, allowing for gentle removal. From the #1 doctor recommended bandage brand, Band-Aid Brand Adhesive Bandages help protect against dirt and germs that may cause infection. Plus wounds covered with a bandage heal faster than uncovered wounds. For proper wound care, treat with wound an antiseptic ointment such as Neosporin prior to application.','Band-Aid Flex-Fabric Assorted, 100 ct'),(000000000000011,7.55,'Books','Naofumi Iwatani, an uncharismatic Otaku who spends his days on games and manga, suddenly finds himself summoned to a parallel universe! He discovers he is one of four heroes equipped with legendary weapons and tasked with saving the world from its prophesied destruction. As the Shield Hero, the weakest of the heroes, all is not as it seems. Naofumi is soon alone, penniless, and betrayed. With no one to turn to, and nowhere to run, he is left with only his shield. Now, Naofumi must rise to become the legendary Shield Hero and save the world!','The Rising of the Shield Hero Volume 01'),(000000000000012,10.99,'Books','Like any shy teen turned young adult, YouTube star James Rallison (\"The Odd 1s Out\") is used to being on the outside looking in. He wasn\'t partying in high school or winning football games like his older brother. Instead, he posted comics on the Internet. Now, he\'s ready to share his hard-earned advice from his 21 years of life in the funny, relatable voice his fans love. ','The Odd 1s Out: How to Be Cool and Other Things I Definitely Learned from Growing Up'),(000000000000013,17.84,'Clothing, Shoes, Jewelry','The 711 Skinny features innovative stretch denim to flatter, hold and lift while making you feel amazing. This jean sits just below the curve of your waist for a universally comfortable fit, and the skinny leg adapts to any style you choose.','Levi\'s Women\'s 711 Skinny Jean'),(000000000000014,49.70,'Toy, Game, Movie','Take your Pokémon journey to the Kanto region with your energetic partner, Pikachu, to become a top Pokémon trainer as you battle other trainers. Use a throwing motion to catch Pokémon in the wild with either one Joy-Con controller or Poké Ball Plus accessory, which will light up, vibrate, and make sounds to bring your adventure to life. Share your adventure with family or friends in two-player action using a second Joy-Con or Poké Ball Plus (sold separately). You can even connect to the Pokémon GO app using a compatible smartphone to bring over Pokémon originally discovered in the Kanto region.','Pokemon: Let\'s Go, Pikachu!'),(000000000000015,2.98,'Snack, Food','Take a delicious break with Oreo Double Stuf Cookies. This Oreo variety sandwiches a double helping of rich creme between the bold taste of two chocolate wafers--making them milk\'s favorite cookie.','Oreo Double Stuf Chocolate Sandwich Cookies, 15.35 Ounce'),(000000000000016,34.55,'Books','A dazzling illustrated edition of the book that started it all—for readers of A Song of Ice and Fire and fans of HBO’s Game of Thrones.','A Game of Thrones: The Illustrated Edition: A Song of Ice and Fire: Book One'),(000000000000017,46.77,'Books','A dazzling illustrated edition of the book that started it all—for readers of A Song of Ice and Fire and fans of HBO’s Game of Thrones.','A Game of Thrones: The Illustrated Edition: A Song of Ice and Fire: Book One'),(000000000000018,44.22,'Books','THE BOOK BEHIND THE SECOND SEASON OF GAME OF THRONES, AN ORIGINAL SERIES NOW ON HBO.','A Clash of Kings (A Song of Ice and Fire, Book 2) '),(000000000000019,44.22,'Books','THE BOOK BEHIND THE THIRD SEASON OF GAME OF THRONES, AN ORIGINAL SERIES NOW ON HBO.','A Storm of Swords (A Song of Ice and Fire, Book 3)'),(000000000000020,42.45,'Books','THE BOOK BEHIND THE FOURTH SEASON OF THE ACCLAIMED HBO SERIES GAME OF THRONES','A Feast for Crows (A Song of Ice and Fire, Book 4) '),(000000000000021,23.44,'Books','In the aftermath of a colossal battle, the future of the Seven Kingdoms hangs in the balance once again--beset by newly emerging threats from every direction.','A Dance with Dragons (A Song of Ice and Fire)'),(000000000000022,79.95,'Home & Kitchen','Instant Pot Duo Mini is the ideal companion to the Duo 6 Quart, 7-in-1 programmable multi-cooker replaces 7 kitchen appliances, combines the functions of a Rice Cooker, Pressure Cooker, Slow Cooker, Steamer, Sauté, Yogurt Maker, and Warmer. 11 smart built-in programs – Rice, Soup/Broth, Meat/Stew, Bean/Chili, Sauté, Steam, Porridge, Yogurt, Slow Cook, and Keep Warm, your favorite dishes are as easy as pressing a button. The Instant Pot Duo Mini Rice Cooker Function cooks up to 6 cups of uncooked rice (12 cups cooked rice), the rice cooker function can cook all types of rice including white rice, brown rice, wild rice, sushi rice, risotto rice and more. Accessories include a rice measuring cup, stainless steel steam rack without handles, rice paddle, soup spoon, condensation collector and recipe booklet. The Duo Mini is versatile it can be used at home to make a small dish for two, side dish or while traveling such as camping, traveling by RV, boating, sailing, hotel excursions etc.. A 24-hour delay start timer for delayed cooking is great for busy families allowing you to have your food ready when you get home from a busy day at work. Automatic keep warm holds the temperature of the dish until you serve. NOTE: This product is 110v and for use in North America, if you live in Europe or other 220-240v territories this product will not operate. When installing the sealing ring, make sure the sealing ring rack is completely set in the groove on the inside of the sealing ring.','Instant Pot Duo Mini 3 Qt 7-in-1 Multi- Use Programmable Pressure Cooker, Slow Cooker, Rice Cooker, Steamer, Sauté, Yogurt Maker and Warmer'),(000000000000023,10.99,'Books','In the ruins of a place once known as North America lies the nation of Panem, a shining Capitol surrounded by twelve outlying districts.','The Hunger Games (Book 1)'),(000000000000024,11.11,'Books','Suzanne Collins continues the amazing story of Katniss Everdeen in the phenomenal Hunger Games trilogy.','Catching Fire Hunger Games 2'),(000000000000028,11.22,'Books','The third book in Suzanne Collinss phenomenal and worldwide bestselling Hunger Games trilogy is now available in paperback','Mockingjay (The Hunger Games)'),(000000000000029,1000.00,'Electronics','8th Generation Intel Core i3-8130U Processor (Up to 3.4GHz)','Acer Aspire E 15, 15.6 inches Full HD, 8th Gen Intel Core i3-8130U, 6GB RAM Memory, 1TB HDD, 8X DVD, E5-576-392H'),(000000000000030,999.99,'Books','Choose from AMD Dual Core A6-9225 at 2.6GHz up to 3.0 GHz, Intel Quad-Core N4100 or N5000\r\nUpgrade Your RAM and Hard Drive up to 8G DDR4, 1TB SSD for Your Desired Specs.','2019 Flagship Lenovo ideaPad 15.6 HD Energy-efficient Laptop AMD Dual-Core A6-9225 Up to 3.0GHz AMD Radeon R4 DVDRW 802.11ac Bluetooth Webcam USB 3.0 HDMI Windows 10 - Up to 8GB DDR4 RAM 1TB SSD'),(000000000000031,299.99,'Electronics','Ready for drops and spills with rugged construction with reinforced rubber guards, easy grip handles, and a spill resistant keyboard','ASUS Chromebook C202SA-YS02 11.6 inches Ruggedized and Water Resistant Design with 180 Degree (Intel Celeron 4 GB, 16GB eMMC, Dark Blue, Silver)'),(000000000000032,999.99,'Electronics','Dual-core 7th-generation Intel Core i5 processor\r\nBrilliant Retina display','Apple MacBook Pro (13 inches Retina, 2.3GHz Dual-Core Intel Core i5, 8GB RAM, 128GB SSD) - Space Gray (Latest Model)'),(000000000000033,1400.00,'Electronics','1.3GHz dual-core Intel Core i5\r\nIntel HD Graphics 615\r\nFast SSD storage\r\n8GB memory','Apple MacBook (12 inches, 1.3GHz dual-core Intel Core i5, 8GB RAM, 512GB SSD) - Silver'),(000000000000034,999.99,'Electronics','6. 5-inch Super Retina display (OLED) with HDR\r\nIP68 dust and water resistant (maximum depth of 2 meters up to 30 minutes)','Apple iPhone XS Max (64GB) - Silver'),(000000000000035,699.99,'Electronics','6.1-inch Liquid Retina display (LCD)\r\nIP67 water and dust resistant (max depth of 1 m up to 30 mins)','Apple iPhone XR (64GB) - (PRODUCT)RED [works exclusively with Simple Mobile]'),(000000000000036,688.32,'Electronics','This phone is locked to Simple Mobile from Tracfone, which means this device can only be used on the Simple Mobile wireless network.','Apple iPhone 8 (64GB) - Silver '),(000000000000037,10.99,'Electronics','Excellent Design: Specifically designed For Samsung Galaxy S8+  S8 Plus SM-G955 (NO Fit Galaxy S8 G950). high quality anti-adsorption membranes makes the product easy to affix and disassemble.It will automatically adsorb the screen.','Samsung Galaxy S8+ Glass Screen Protector-(3 Pack) 2.5D Arc Clear Anti-Glare Ultra-Thin 9H Full Coverage Silk Print Tempered Protective Film for Samsung Galaxy S8+  S8 Plus SM-G955 (NO Fit GalaxyS8)'),(000000000000038,25.99,'Electronics','* Does Not Include Holster **** Compatible with Samsung Galaxy S8+ (PLUS) ONLY - (NOT for the Galaxy S8)','OtterBox Defender Series for Samsung Galaxy S8+ Plus Screenless Design'),(000000000000039,677.98,'Electronics','Super Speed Dual Pixel Camera; Music Play Time: AOD off: Up to 90 hours, AOD on: Up to 51 hours','Samsung Galaxy S9 Unlocked Smartphone - 64GB - Midnight Black - US Warranty'),(000000000000040,142.99,'Music Instrument','30-Key Baby Grand is excellent for children who have been introduced to pianos and beginning their journey to performance pieces','Schoenhut 30-Key Fancy Baby Grand with Bench,Black'),(000000000000041,85.99,'Books','37 keys, 8 percussion instruments, 3 teaching modes, 8 musical instruments','Little Princess Educational 37 Keys Keyboard Kids Toy Piano with Bench and Microphone can Connect MP3 Mobile Phone for Toddlers by Baoli'),(000000000000042,87.22,'Music Instrument','Spruce Top\r\nMeranti Back & Sides\r\nRosewood Fingerboard & Bridge\r\nNatural Finish','Yamaha Student Series CGS103AII Classical Guitar, Natural'),(000000000000043,19.99,'Toy, Game, Movie','Interactive Game：provides quality time together, the whole family playing together is the best gift','Marble Run Set 105 Pcs - Construction Building Blocks Toys Game for 4 5 6 7 Year Old Boys Girls Kids'),(000000000000044,32.33,'Toy, Game, Movie','Ideal Educational Toy Gift: Marble Building Set for Kids Both Boys and Girls Ages 3 and Up;Enjoy Building Various Tracks and See Marbles go up,Down,all around,and Fast!','BATTOP Marble Run Building Blocks Construction Toys Set Puzzle Race Track for Kids-97 Pieces'),(000000000000045,20.99,'Toy, Game, Movie','EVERY BOXS HAS MORE THAN 500 PC !— Build and learn flowers, animals, alphabets, numbers, bridges, towers and more! Your children are only limited by their own imaginations','Auoxer Building Block Toys of 500 Pieces, Gear Flakes Connect Interlocking Plastic Disc, A Creative and Educational Construction Toy Bricks - Best Gift for Boys and Girls'),(000000000000046,19.99,'Toy, Game, Movie','Enhance your kids hands-on, imagination and creativity while teaching through lively activities. Improve his or her logical thinking, concentration and planning skills during the process of playing.','HOCHE 6 Pack Dinosaur Building Blocks Toys in Jumbo Easter Eggs for Kids Boys Girls Easter Gifts Easter Basket Stuffers Fillers'),(000000000000047,39.00,'Pet Supplies','HAMMOCK WITH SIDE FLAPS - It is easier for your dog to get in or out of car. Also side flaps can protect your car door from scratch, hair. Versatile split zipper hammock to allow pets and kids can share the back seat when zip up for a full hammock or zip down for half/half so dogs and passengers can travel together.','URPOWER Dog Seat Cover Car Seat Cover for Pets 100%Waterproof Pet Seat Cover Hammock 600D Heavy Duty Scratch Proof Nonslip Durable Soft Pet Back Seat Covers for Cars Trucks and SUVs'),(000000000000048,9.99,'Pet Supplies','PORTABLE & CONVENIENT: Collapsible dog bowl is 5.1 inches wide, 2.1 inches height, each bowl holds up to 12 fluid ounces of water or 1.5 cups of dog food. - 0.5 inches when compact - simply Pop-Up and then fold away','COMSUN Collapsible Dog Bowl, Foldable Expandable Cup Dish for Pet Cat Food Water Feeding Portable Travel Bowl Free Carabiner'),(000000000000049,7.99,'Pet Supplies','Made of high quality nylon fabric to ensure safety, features the solid zinc alloy swivel snap and metal buckles guarantee extra durability','Vastar 2 Packs Adjustable Pet Dog Cat Car Seat Belt Safety Leads Vehicle Seatbelt Harness'),(000000000000050,23.99,'Pet Supplies','11 Lb. Bag - Purina Beyond Grain Free Ocean Whitefish and Egg Recipe Adult Dry Cat Food\r\nPackaging May Vary','Purina Beyond Grain Free, Natural, Adult Dry Cat Food'),(000000000000051,2.22,'Pet Supplies','Twelve (12) 3 oz. Cans - Purina Beyond Natural Grain Free Alaskan Cod Recipe Adult Wet Cat Food\r\nRegionally sourced Alaskan cod is the 1st ingredient\r\nCod sourced from sustainable fisheries verified by the Marine Stewardship Council\r\nGrain-free formula\r\nEach serving is high in protein','Purina Beyond Grain Free, Natural, Adult Canned Wet Cat Food'),(000000000000052,14.22,'Pet Supplies','Twelve (12) 3 Oz. Can - Purina Beyond Simple Origins Grain Free Pate Pacific Cod, New England Herring and Spinach Recipe Adult Wet Cat Food','Purina Beyond Natural, Grain Free Pate Wet Cat Food Simple Origins Cod, Herring and Spinach Recipe - 3 oz. Can'),(000000000000053,34.77,'Pet Supplies','The Original Curious Cat Cube by MidWest! This cat cube measures 15.5W x 15.5L x 16.5H when assembled, brown faux suede and synthetic sheepskin.','Midwest Curious Cat Cube, Cat House/Cat Condo'),(000000000000054,29.99,'Pet Supplies','Color : Brown/Black\r\nSize : 19.25W x 19.25L x 23H\r\nBoard Material : Wood','Go Pet Club 23 in. Cat Tree'),(000000000000055,66.23,'Pet Supplies','Multi-platform cat tree with scratching posts and enclosure\r\nTiered platforms provide space for your cat to relax, play, and climb','Basics Multi-Level Cat Tree'),(000000000000056,2.33,'Pet Supplies','Stop cats from destroying furniture. (1) roll, 32.8 ft\r\nTransparent tape is easy to apply and remove from all furniture\r\nEasy to apply and remove. Use on countertops, drapes, carpets, anywhere you do not want kitty to be','Sticky Paws Scratch Control Strips');

