o some surplus items we run across. Working hard to provide you high quality and sometimes hard to find items with great service. We will tell you exactly what we are selling. We want you to be satisfied for sure'),(000000000000018,'Fish Comics','6316329999','1599 Curabitur Rd.',NULL,'Ciara','NC','USA','13251','I have been collecting comics since 1975. Since then I have expanded into selling comics. I did shows in the early 1990\'s and opened a store Blue Chip Comics in 1993. I started selling on-line in 1995. I still sell on-line www.fishsaucecomics.com'),(000000000000019,'Get Import CDs','6316329999','1599 Curabitur Rd.',NULL,'Ciara','NC','USA','13251','We love Music, and want to share this love with you!'),(000000000000020,'Discover Books','6316329999','1599 Curabitur Rd.',NULL,'Ciara','NC','USA','13251','Discover Books was among the first of its kind to harness the potential of the used book market to redistribute used books to local communities and on a national scale. We offer some of the lowest prices available online.');

